	IF(P_Merc_ID IS NOT NULL)  THEN
		SELECT * FROM IPG.View_Transactions
		WHERE Cust_ID = P_Cust_ID
		AND Merc_ID IN (SELECT Merc_ID FROM UserMerchant WHERE userId =  P_USER_ID)
        AND Merc_ID = P_Merc_ID;
	ELSE
		SELECT * FROM IPG.View_Transactions
		WHERE Cust_ID = P_Cust_ID
		AND Merc_ID IN (SELECT Merc_ID FROM UserMerchant WHERE userId =  P_USER_ID);
    END IF;
END ;;
